(16, 1, 'GOSBI MATERNAL LECHE DE PERRO EN POLVO 400GR', '', '<p>\r\n	<span style=\"color: rgb(33, 37, 41); font-family: Raleway; font-size: 16px; text-align: justify; background-color: rgb(243, 243, 243);\">Maternal es un alimento completo en polvo, adecuado para la nutrici&oacute;n de cachorros, substituyendo o como complemento de la leche materna en caso de camadas que necesitan un apoyo nutricional.</span></p>', '', '', '', '', '', 16),
