(85, 1, 'PIPETA FIPREX DUO PERROS DE 10 A 20 KG', '', '<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem; font-size: 16px; color: rgb(12, 12, 12); font-family: &quot;Open Sans&quot;;\">\r\n	Fiprex Pipetas Antiparasitarias Perros 10-20kg es un producto antiparasitario indicado para tratar las infestaciones de pulgas y garrapatas.</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem; font-size: 16px; color: rgb(12, 12, 12); font-family: &quot;Open Sans&quot;;\">\r\n	Fiprex Pipetas Antiparasitarias Perros 10-20kg muestra un efecto insecticida inmediato y una actividad insecticida persistente contra nuevas infestaciones de pulgas adultas hasta 8 semanas. El producto tiene una eficacia acaricida persistente contra Rhipicephalus sanguineus y Dermacentor reticulatus hasta 4 semanas.</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem; font-size: 16px; color: rgb(12, 12, 12); font-family: &quot;Open Sans&quot;;\">\r\n	Si est&aacute;n presentes garrapatas de estas especies cuando el producto es aplicado, no todas las garrapatas morir&aacute;n en las primeras 48 horas, sino que pueden morir en el transcurso de una semana. El producto puede ser utilizado como parte de una estrategia de tratamiento para el control de la Dermatitis Al&eacute;rgica a la Picadura de Pulgas (DAPP) donde esta haya sido previamente diagnosticada por un veterinario</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem; font-size: 16px; color: rgb(12, 12, 12); font-family: &quot;Open Sans&quot;;\">\r\n	Composici&oacute;n:&nbsp;Una pipeta (2 ml.) contiene 150 mg de fipronilo por perro de 10 a 20kg.</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem; font-size: 16px; color: rgb(12, 12, 12); font-family: &quot;Open Sans&quot;;\">\r\n	Posolog&iacute;a: Abra la pipeta quitando la punta. Separe el pelo del animal entre los om&oacute;platos y aplique el contenido de la pipeta sobre la piel. En ausencia de estudios de seguridad, el intervalo de aplicaci&oacute;n m&iacute;nima es de 4 semanas.</p>', '', '', '', '', '', 92),
