(439, 1, 'ORGANIZADOR Y DIVISOR PARA COCHE', '', '<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding-left: 1em; color: rgb(24, 24, 24); font-family: Barlow, -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, roboto, &quot;Helvetica Neue&quot;, arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">\r\n	<li style=\"box-sizing: border-box; margin-left: 25px; list-style: none;\">\r\n		Material: poli&eacute;ster</li>\r\n	<li style=\"box-sizing: border-box; margin-left: 25px; list-style: none; margin-top: 0.25em;\">\r\n		&nbsp;Apta para todas las marcas de coches</li>\r\n	<li style=\"box-sizing: border-box; margin-left: 25px; list-style: none; margin-top: 0.25em;\">\r\n		F&aacute;cil de montar sistema de sujeci&oacute;n</li>\r\n	<li style=\"box-sizing: border-box; margin-left: 25px; list-style: none; margin-top: 0.25em;\">\r\n		Plegable y f&aacute;cil de limpiar</li>\r\n	<li style=\"box-sizing: border-box; margin-left: 25px; list-style: none; margin-top: 0.25em;\">\r\n		Con ribetes y compartimento de almacenamiento</li>\r\n</ul>', '', '', '', '', '', 25),
(440, 1, 'PACK DENTAL BEAPHAR', '', '<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	<strong _msthash=\"2542644\" _msttexthash=\"1662544\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box;\">PASTA DE DIENTES ESPECIALMENTE FORMULADA PARA PERROS Y GATOS</strong></p>\r\n<p _msthash=\"2542645\" _msttexthash=\"21162752\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	La Pasta de Dientes para Perro Beaphar est&aacute; formulada a partir de sustancias minerales de Tripolifosfato de sodio que evitan que la placa dental se convierta, mediante acumulaci&oacute;n de calcio, en sarro.</p>\r\n<p _msthash=\"2542646\" _msttexthash=\"89792157\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	El cuidado dental de los perros y gatos es muy importante como ya que sus enc&iacute;as est&aacute;n muy expuestas al desgaste diario y a la acumulaci&oacute;n de sarro, que puede derivar en problemas importantes de salud. Para evitar estose debe hacer una limpieza bucal a las mascotas varias veces a la semana. El cepillado regular con la Pasta de Dientes para Perro Beaphar ayuda a prevenir la formaci&oacute;n de sarro y los problemas derivados de esto.</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	<strong _msthash=\"2542647\" _msttexthash=\"229164\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box;\">CARACTER&Iacute;STICAS</strong></p>\r\n<p _msthash=\"2542648\" _msttexthash=\"1349231\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Sabor a carne:les encanta a los perros y gatos&nbsp;</p>\r\n<p _msthash=\"2542649\" _msttexthash=\"3546569\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Puedes utilizarlo tanto en perros como en gatos, de todas las razas y tama&ntilde;os</p>\r\n<p _msthash=\"2542650\" _msttexthash=\"644982\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Contiene enzimas anti-sarro</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	&nbsp;</p>\r\n<p _msthash=\"2542651\" _msttexthash=\"583323\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	CEPILLO DE DIENTES CON DOBLE MANGO</p>\r\n<p _msthash=\"2542652\" _msttexthash=\"29300544\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	El Cepillo de Dientes Beaphar se adapta a tu mano y puedes utilizarlo en tanto en perros como en gatos, de todas las razas y tama&ntilde;os. Las cerdas del cepillo se ajustan a los dientes y enc&iacute;as de tu perro, incluso en las zonas de dif&iacute;cil alcance.</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	<strong _msthash=\"2542653\" _msttexthash=\"229164\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box;\">CARACTER&Iacute;STICAS</strong></p>\r\n<p _msthash=\"2542654\" _msttexthash=\"376987\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Se adaptar&aacute; a tu&nbsp; mano</p>\r\n<p _msthash=\"2542655\" _msttexthash=\"3546569\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Puedes utilizarlo tanto en perros como en gatos, de todas las razas y tama&ntilde;os</p>\r\n<p _msthash=\"2542656\" _msttexthash=\"6510816\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; font-family: avenir-lt-w01_85-heavy1475544, avenir-lt-w05_85-heavy, sans-serif; line-height: inherit; color: rgb(0, 0, 0);\">\r\n	Las cerdas del cepillo se ajustan a los dientes y enc&iacute;as de tu perro, incluso en las zonas de dif&iacute;cil alcance.</p>', '', '', '', '', '', 253),
(443, 1, 'COLONIA TALCO MEN FOR SAN 125ML', '', '<p>\r\n	<span style=\"color: rgb(30, 44, 64); font-family: &quot;SourceSansPro Regular&quot;, sans-serif; font-size: 15px;\">Agua de colonia talco para perros con fragancias frutales naturales especialmente creadas para proporcionar despu&eacute;s del ba&ntilde;o un olor fresco y un intenso efecto desodorante muy agradable respetando la piel y las propiedades olfativas del animal. No contienen alcohol y tienen PH neutro, careciendo de efectos irritantes y evitando que el perro estornude despu&eacute;s de su aplicaci&oacute;n. MODO DE EMPLEO: Aplicar despu&eacute;s del ba&ntilde;o en &aacute;rea del cuello y del lomo.</span></p>', '', '', '', '', '', 181),
(444, 1, 'COLONIA MANGO ARPPE 125ml', '', '', '', '', '', '', '', 170),
(445, 1, 'NINA OTTOSSON CHALLENGE SLIDER', '', '<p>\r\n	<font style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; box-sizing: border-box; vertical-align: inherit;\">C&Oacute;MO JUGAR: Coloque las golosinas o alimentos favoritos de su perro en los compartimentos de la bandeja extra&iacute;ble.&nbsp;</font><font style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; box-sizing: border-box; vertical-align: inherit;\">Deslice la bandeja de nuevo en el juego.&nbsp;</font><font style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; box-sizing: border-box; vertical-align: inherit;\">Supervise, muestre y anime a su perro a mover los controles deslizantes hacia adelante y hacia atr&aacute;s para buscar golosinas.&nbsp;</font><font style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; box-sizing: border-box; vertical-align: inherit;\">Si su perro es demasiado rudo con sus patas, coloque el juego en su regazo o en un taburete, de modo que su perro solo pueda usar su nariz para mover los controles deslizantes.&nbsp;</font><font style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; box-sizing: border-box; vertical-align: inherit;\">&iexcl;Que empiecen los juegos!</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">ES F&Aacute;CIL DE LLENAR: saque la bandeja, llene los compartimentos con golosinas o alimentos, deslice la bandeja hacia atr&aacute;s nuevamente.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">REGLAS DE JUEGO: Debido a que es un juego desafiante, le recomendamos que jueguen juntos y le ense&ntilde;en a su perro las reglas del juego y c&oacute;mo funciona.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">DIVERSI&Oacute;N PARA TODOS LOS PERROS: este rompecabezas es avanzado, por lo que es m&aacute;s adecuado para perros que han jugado otros juegos antes y tienen habilidades motoras finas, independientemente de su edad, tama&ntilde;o o raza.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\"><font style=\"box-sizing: border-box; vertical-align: inherit;\">ROMPECABEZAS CONGELADOS: Mezcle un poco de carne enlatada con agua, vierta un poco de la mezcla en los compartimentos de la bandeja, o coloque un trozo peque&ntilde;o de salchicha o una delicia en cada compartimento, vierta un poco de agua, meta el juego en el congelador y deja que se asiente.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Esto es perfecto para perros que necesitan algo de actividad extra.</font></font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">REDUCE LOS COMPORTAMIENTOS DESTRUCTIVOS: al mantener la mente de su perro ocupada, los juguetes de rompecabezas pueden ayudar a reducir los comportamientos no deseados.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">JUEGA Y CON&Eacute;CTATE: el Challenge Slider es una excelente manera de relacionarte con tu perro mientras le ense&ntilde;as los comandos b&aacute;sicos de entrenamiento de una manera divertida.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">HACE QUE LA ALIMENTACI&Oacute;N SEA DIVERTIDA: este rompecabezas de golosinas se puede usar para alimentar a su perro con golosinas saludables o croquetas secas: resolver el rompecabezas de alimentos crea una hora de comida atractiva y lenta.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">LIBRE DE BPA, PVC Y FTALATOS: fabricado con materiales aptos para alimentos en los que puede confiar para su perro.</font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\"><font style=\"box-sizing: border-box; vertical-align: inherit;\">F&Aacute;CIL DE LIMPIAR: Para lavar, simplemente retire todas las golosinas/croquetas y l&aacute;velas a mano con agua jabonosa tibia, enjuague y seque.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">&iexcl;Ll&eacute;nalo de nuevo para m&aacute;s diversi&oacute;n!</font></font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\"><font style=\"box-sizing: border-box; vertical-align: inherit;\">ES DIVERTIDO.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">SE ALIMENTA.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">&iexcl;Es un desaf&iacute;o que tu perro necesita!&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Nina Ottosson Treat Puzzle Games combate el aburrimiento, ayuda a reducir los comportamientos destructivos y ejercita la mente de su perro.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Es ocultar y buscar con golosinas, &iexcl;y a los perros les encanta!</font></font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\"><font style=\"box-sizing: border-box; vertical-align: inherit;\">PRECAUCI&Oacute;N: Este no es un juguete para masticar.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Inspeccione peri&oacute;dicamente en busca de da&ntilde;os y ret&iacute;relos y reempl&aacute;celos si est&aacute;n rotos o si las piezas se separan, ya que pueden producirse lesiones graves.</font></font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\"><font style=\"box-sizing: border-box; vertical-align: inherit;\">Supervise SIEMPRE a su perro cuando utilice el Challenge Slider.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Una vez vaciado de golosinas o croquetas, el juego debe almacenarse hasta el pr&oacute;ximo uso supervisado.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Destinado solo para mascotas.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Mantener fuera del alcance de los ni&ntilde;os.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">Nina Ottosson Dog Puzzle Games &curren; Combate el aburrimiento manteniendo ocupado a su perro &ndash; Boredom Busters &curren; Ayuda a reducir el comportamiento destructivo al ejercitar la mente de su perro.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">&curren; Fortalece el v&iacute;nculo con tu perro.&nbsp;</font><font style=\"box-sizing: border-box; vertical-align: inherit;\">&curren; Diversi&oacute;n para todos los perros, independientemente de su edad y tama&ntilde;o.</font></font></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<font style=\"box-sizing: border-box; vertical-align: inherit;\">Tama&ntilde;o: 37x37x5cm</font></p>', '', '', '', '', '', 156),
(448, 1, 'DELICUPS TUNA PRAWN 6x22GR', '', '<p>\r\n	<span style=\"color: rgb(36, 36, 36); font-family: ECI; font-size: 14px; text-align: justify;\">Snacks para gatos adultos, a base de at&uacute;n y gambas, que encantar&aacute;n a tu felino. Seis envases de 22 g c/uno.</span></p>\r\n<h2 class=\"product_detail-description-heading pdd_h2\" style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 24px; font-family: ECI; margin: 1rem 0px 0.5rem; padding: 0px; -webkit-font-smoothing: antialiased; text-transform: uppercase; letter-spacing: 1.4px; color: rgb(36, 36, 36); display: inline;\">\r\n	INGREDIENTES:</h2>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: ECI; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased; font-size: 14px; color: rgb(36, 36, 36); text-align: justify;\">\r\n	Pescado (76% de at&uacute;n / 10,2% de salm&oacute;n), gambas (8%), caldo de pescado, Vit. E, harina de arroz, carragenano.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<h2 class=\"product_detail-description-heading pdd_h2\" style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 24px; font-family: ECI; margin: 1rem 0px 0.5rem; padding: 0px; -webkit-font-smoothing: antialiased; text-transform: uppercase; letter-spacing: 1.4px; color: rgb(36, 36, 36); display: inline;\">\r\n	COMPONENTES ANAL&Iacute;TICOS:</h2>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: ECI; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased; font-size: 14px; color: rgb(36, 36, 36); text-align: justify;\">\r\n	Prote&iacute;na bruta 6,1%, grasa bruta 2%, fibra bruta 0,4%, ceniza bruta 1,2%, humedad 87%.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<h2 class=\"product_detail-description-heading pdd_h2\" style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 24px; font-family: ECI; margin: 1rem 0px 0.5rem; padding: 0px; -webkit-font-smoothing: antialiased; text-transform: uppercase; letter-spacing: 1.4px; color: rgb(36, 36, 36); display: inline;\">\r\n	RACI&Oacute;N DIARIA RECOMENDADA:</h2>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: ECI; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased; font-size: 14px; color: rgb(36, 36, 36); text-align: justify;\">\r\n	- Gatos adultos: 2-3 porciones al d&iacute;a entre comidas.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: ECI; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased; font-size: 14px; color: rgb(36, 36, 36); text-align: justify;\">\r\n	- Gatos &gt;6 meses: 1 porci&oacute;n al d&iacute;a entre comidas.</p>', '', '', '', '', '', 136),
