(942, 1, 'naturadiet mini lamb 500gr', '', '<p style=\"box-sizing: border-box; padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">\r\n	<span style=\"box-sizing: border-box;\">Alimento completo, saludable e hipoal&eacute;rgenico, elaborado con ingredientes naturales de baja o nula capacidad alerg&eacute;nica.para perros adultos de cualquier raza o tama&ntilde;o, nd lamb &amp; rice refuerza el sistema inmunitario y favorece el peso ideal del animal.proteina 24 %,contenido en grasa 14 %,fibra bruta 2,5 %,materia inorg&aacute;nica 7 %,humedad 10 %.</span></p>\r\n<h3 style=\"box-sizing: border-box; padding: 0px 0px 4px; margin: 0.75em 0px 0.375em -1px; text-rendering: optimizelegibility; font-weight: normal; font-size: 1.23em; line-height: 24px; color: rgb(51, 51, 51); clear: left; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\">\r\n	<span style=\"box-sizing: border-box;\">Ingredientes</span></h3>\r\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0em 0px 1em 1em; color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">\r\n	<span style=\"box-sizing: border-box;\">Carne de cordero deshidratado (25%), arroz pulido(15%), arroz integral (5%),concentrado de prote&iacute;nas vegetales AD*,&nbsp; salm&oacute;n deshidratado (3%), pulpa de remolacha, huevo deshidratado, fibras vegetales, aceite de salm&oacute;n, aceite de linaza, cloruro pot&aacute;sico, PROHEALTH (1%): extracto de mejill&oacute;n de labios verdes, extracto de krill, zanahoria deshidratada, tomate deshidratado, rosa de la India deshidratada, alfalfa deshidratada, algas deshidratadas, extracto de semilla de diente de le&oacute;n, br&oacute;coli deshidratado, extracto de semilla de t&eacute; verde, manzanilla deshidratada, extracto de c&iacute;tricos, aceite de borraja,&nbsp; extracto de semilla de or&eacute;gano, extracto de semilla de cardo mariano, ar&aacute;ndanos, L-carnitina, taurina, FOS, MOS, probi&oacute;ticos, PROSAFE COMPLEX (0.03%): romero, clavo, pomelo y extracto de uva deshidratados, aceites vegetales ricos en alfa tocoferoles</span></p>', '', '', '', '', '', 2),
