(560, 1, 'TENDON DE VACA', '', '<p>\r\n	<span style=\"color: rgb(133, 133, 133); font-family: &quot;Basic Commercial&quot;, sans-serif; font-size: 17px;\">Snack natural para perros. Contiene 1 ud.</span></p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; color: rgb(133, 133, 133); font-family: &quot;Basic Commercial&quot;, sans-serif; font-size: 17px;\">\r\n	Duro en su estado normal, se ablanda gracias a la masticaci&oacute;n lo que lo convierte en una distracci&oacute;n duradera perfecta para rebajar los niveles de estr&eacute;s, ideal como entretenimiento..</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; color: rgb(133, 133, 133); font-family: &quot;Basic Commercial&quot;, sans-serif; font-size: 17px;\">\r\n	Perros de todas las razas j&oacute;venes y adultos.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; color: rgb(133, 133, 133); font-family: &quot;Basic Commercial&quot;, sans-serif; font-size: 17px;\">\r\n	Disponible en 2 tama&ntilde;os.</p>', '', '', '', '', '', 88),
