(938, 1, 'OPTIMA NOVA PUPY 12KG', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	Optima Nova Puppy Medium es un alimento de alta calidad que se elabora con un<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&nbsp;65% de carne de pollo acompa&ntilde;ada de arroz</strong>. Es un pienso monoproteico, ya que las prote&iacute;nas provienen de un &uacute;nico tipo de carne, consiguiendo con esto una mayor aceptaci&oacute;n en animales con intolerancias o alergias a algunos alimentos. Los ingredientes que utiliza Optima Nova son 100% naturales, aptos para el consumo humano y&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">sin ning&uacute;n tipo de conservante, colorante ni aromatizante artificial</strong>.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	La comida para cachorros de razas medianas Optima Nova se caracteriza por fortalecer el sistema inmune y la salud cardiovascular del animal, por contribuir a tener un&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">sistema digestivo sano y una f&aacute;cil digesti&oacute;n</strong>, por cuidar la piel y el pelo gracias a los&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&aacute;cidos grasos omega 3</strong>&nbsp;que incorpora y por elaborarse con ingredientes de alta calidad como la carne fresca de pollo que aumenta su palatabilidad. El cuidadoso proceso de fabricaci&oacute;n del pienso Optima Nova mantiene todas las prote&iacute;nas, nutrientes y el sabor natural de la carne. El pienso para cachorros de Optima Nova est&aacute;&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">disponible tambi&eacute;n para razas peque&ntilde;as y grandes</strong>, adapt&aacute;ndose a las necesidades del tama&ntilde;o de cada perro.</p>\r\n<h3 style=\"box-sizing: border-box; margin: 18px 0px 9px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.1; font-family: Montserrat, sans-serif; font-size: 23px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	<br style=\"box-sizing: border-box;\" />\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Ventajas</strong></h3>\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 9px; padding-right: 0px; padding-left: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(119, 119, 119);\">\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Pienso de alta calidad para cachorros de razas medium.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Elaborado con un 65% de carne de pollo apta para el consumo humano.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Pienso monoproteico para una mayor aceptaci&oacute;n en casos de intolerancias alimentarias.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Sin colorantes, conservantes ni aromatizantes artificiales.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Nutricionalmente equilibrado para un crecimiento y desarrollo &oacute;ptimos.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Con &aacute;cidos grasos omega 3 para cuidar el manto y la piel.</li>\r\n</ul>\r\n<h3 style=\"box-sizing: border-box; margin: 18px 0px 9px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.1; font-family: Montserrat, sans-serif; font-size: 23px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	<br style=\"box-sizing: border-box;\" />\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Uso y especificaciones&nbsp;</strong></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	Pienso Optima Nova Puppy Medium adecuado para una alimentaci&oacute;n equilibrada y sana de cachorros de razas medianas desde los 2 hasta los 12 meses.</p>\r\n<h3 style=\"box-sizing: border-box; margin: 18px 0px 9px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.1; font-family: Montserrat, sans-serif; font-size: 23px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Ingredientes</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	Pollo fresco (35%). Pollo deshidratado (25%). Arroz (15%). Aceites y grasas (pescado 0,5%). Hidrolizado de h&iacute;gado de pollo (5%). Prote&iacute;na de arroz. Levaduras. Pulpa de remolacha. Semilla de linaza (1%). Fosfato monoc&aacute;lcico. Cloruro s&oacute;dico. Cloruro pot&aacute;sico. Inulina (500 mg/kg - FOS). Manano-oligosac&aacute;ridos (130 mg/kg). Yucca schidigera.</p>\r\n<h3 style=\"box-sizing: border-box; margin: 18px 0px 9px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.1; font-family: Montserrat, sans-serif; font-size: 23px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Constituyentes anal&iacute;ticos</h3>\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 9px; padding-right: 0px; padding-left: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(119, 119, 119);\">\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Prote&iacute;na bruta 30,00%</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Aceites y grasas brutos 19,00%</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		EPA DHA 530 mg/kg</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-h