variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Montserrat, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	Dale a tu cachorro la cantidad de pienso recomendada en la tabla teniendo en cuenta su edad y su peso. Hasta los 4 meses debes mezclar 1 parte de agua por 3 de alimento y dividirlo en 4 o 5 tomas al d&iacute;a. Despu&eacute;s reduce de manera gradual las tomas hasta darle 2 comidas al d&iacute;a</p>', '', '', '', '', '', 50),
