(737, 1, 'ACEITE CBD PARA FULL SPECTRUM 10ML', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	<strong>El aceite CBD puede ayudar a nuestros animales en: Enfermedades inflamatorias intestinales, enfermedades neurodegenerativas, promover la salud cardiovascular, tratar convulsiones y la epilepsia, reducir la infamaci&oacute;n cr&oacute;nica, proteger el sistema nervioso, mejorar la salud general, dismnuir la inflamaci&oacute;n, controlar las na&uacute;seas, mejorar la movilidad, aumentar el apetito, reducir la ansiedad, puede convatir el canc&eacute;r, aliviar el dolor...etc</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	Muchas personas cuestionan si el CBD es adecuado para sus animales. Debido a su asociaci&oacute;n con la planta de cannabis, algunas podr&iacute;an mostrarse reacias a utilizar CBD con sus animales. Pero el CBD no es el responsable de los efectos psicoactivos de la planta. Por lo tanto, utilizar CBD con nuestros animales no har&aacute; que estos sufran efectos psicotr&oacute;picos.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	El CBD goza cada vez de m&aacute;s popularidad en el utilizo en los animales. La ciencia ha demostrado que este compuesto ofrece muchos beneficios para la salud, y esto es debido a sus propiedades antiinflamatorias, neuro-protectoras y anticonvulsivas. El CBD se utiliza a menudo para aliviar ciertos trastornos, pero tambi&eacute;n se utiliza para mantener y optimizar el bienestar a diario. Puesto que este cannabinoide act&uacute;a sobre el sistema endocannabinoide, que regula y equilibra otros sistemas fisiol&oacute;gicos del organismo.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	Mayoritariamente los productos de CBD son derivados del c&aacute;&ntilde;amo industrial o de variedades de cannabis ricas en CBD, a diferencia del cannabis desarrollado de forma selectiva para que produzca un nivel alto de THC (psicotr&oacute;pico). Esto significa que la mayor&iacute;a de los productos de CBD contienen poco o nada de este cannabinoide psicoactivo, concretamente en todo el territorio nacional espa&ntilde;ol, el l&iacute;mite legal de THC en los productos de CBD deben ser inferiores a 0,2% de THC.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	&iquest;C&Oacute;MO FUNCIONA EL CBD EN LAS MASCOTAS?<br style=\"box-sizing: border-box;\" />\r\n	En el caso de productos CBD en animales cabe destacar que los cannabinoides como el CBD act&uacute;an a trav&eacute;s del sistema endocannabinoide, un sistema fisiol&oacute;gico que no es exclusivo de los seres humanos. Muchos vertebrados tienen sistemas endocannabinoides, incluidos diversos animales como los perros, gatos, roedores e incluso reptiles.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	<br style=\"box-sizing: border-box;\" />\r\n	El CBD es un potente antioxidante que reduce da&ntilde;os en el ARN, por un lado ayuda a manejar el dolor, lo que lo convierte en un potencial agente terap&eacute;utico en fase de envejecimiento del animal y por otro lado se ha demostrado que reduce la inflaci&oacute;n, que es la causa de muchos trastornos de salud y tambi&eacute;n un potencial agente capaz de calmar la sensaci&oacute;n de ansiedad.<br style=\"box-sizing: border-box;\" />\r\n	En general, el CBD es un producto excelente para aliviar la sintomatolog&iacute;a de diversos trastornos de los animales, y podr&iacute;a desempe&ntilde;ar un papel importante para conservar su salud y mantener su homeostasis.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	&iquest;QU&Eacute; DICE LA CIENCIA?<br style=\"box-sizing: border-box;\" />\r\n	El CBD ha demostrado ser seguro tanto in vitro (en cultivos celulares) como in vivo (en organismos vivos como animales y humanos). Una publicaci&oacute;n del 2011 en la revista acad&eacute;mica Current Drug Safety, analiz&oacute; la seguridad de este cannabinoide.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	En una amplia gama de dosis, el CBD no tuvo ning&uacute;n efecto sobre la presi&oacute;n sangu&iacute;nea, la frecuencia card&iacute;aca, la temperatura corporal, los niveles de glucosa, el pH, los niveles de sodio y potasio, o el tr&aacute;nsito gastrointestinal de nuestras mascotas. Adem&aacute;s, no se observaron efectos adversos en lo referente a las funciones psicol&oacute;gicas y del desarrollo psicomotor. Estos resultados siguieron siendo los mismos incluso despu&eacute;s de un per&iacute;odo de 14 d&iacute;as de tratamiento. No se observaron efectos t&oacute;xicos en sujetos animales durante per&iacute;odos hasta 135 d&iacute;as.<br style=\"box-sizing: border-box;\" />\r\n	El CBD parece modificar la actividad de ciertas enzimas del h&iacute;gado, lo que podr&iacute;a afectar a la forma en que este &oacute;rgano metaboliza. Si a tu mascota le han recetado un medicamento, es mejor consultar con el veterinario antes de administrar CBD al animal.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	<br style=\"box-sizing: border-box;\" />\r\n	&iquest;ES EL CBD ADECUADO PARA MI MASCOTA?<br style=\"box-sizing: border-box;\" />\r\n	El CBD es beneficioso para ciertos trastornos, pero tambi&eacute;n puede interactuar con algunos medicamentos. Antes de administrar CBD a tu mascota, debes consultar con el/la profesional veterinario/a para asegurarte de que el uso de CBD beneficie a tu animal. Si es as&iacute;, hay varias formas de administrarlo.<br style=\"box-sizing: border-box;\" />\r\n	El aceite de CBD para perros y gatos es f&aacute;cil de administrar y promueve el correcto funcionamiento diario de tus queridos compa&ntilde;eros. Incluso los animales dom&eacute;sticos que est&eacute;n en buena forma fisiol&oacute;gica pueden beneficiarse de las propiedades potenciadoras de la salud del CBD.<br style=\"box-sizing: border-box;\" />\r\n	El CBD es bastante efectivo para la mejora y fortalecimiento de un pelaje sano. El CBD contiene una gran cantidad de nutrientes que benefician la piel y el pelaje de tu mascota. &Aacute;cidos grasos omega-3, vitaminas A, B1, B12, B2, B6, C, E, y K2, y minerales como calcio, hierro, manganeso y zinc.<br style=\"box-sizing: border-box;\" />\r\n	Adem&aacute;s, cabe se&ntilde;alar que el CBD ayuda con los problemas relacionados al envejecimiento, la obesidad, el c&aacute;ncer, la osteoartritis y el glaucoma.<br style=\"box-sizing: border-box;\" />\r\n	Para conocer la mejor manera de utilizar el aceite de CBD con nuestro animal, lo id&oacute;neo es realizar una consulta directamente al profesional como indic&aacute;bamos al comienzo, puesto que el profesional est&aacute; capacitado y formado para indicar el uso id&oacute;neo para el animal en concreto, en base a sus necesidades, patolog&iacute;as o historial.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(0, 0, 0); font-family: &quot;Claire News&quot;, serif; font-size: 15px;\">\r\n	Tenerife.Bio vende el CBD para animales &uacute;nicamente para su uso t&oacute;pico ya que deber&iacute;a ser el profesional sanitario (en este caso veterinario) el especialista que recomendar&aacute; otros tipos de uso en el caso lo reputara conveniente para tu mascota y por su espec&iacute;fico caso.</p>', '', '', '', '', '', 116),
