(871, 1, 'OPTIMA NOVA MINI POLLO 2KG', '', '<blockquote style=\"box-sizing: border-box; margin: 0px 0px 18px; padding: 9px 18px; border-width: 0px 0px 0px 5px; border-top-style: initial; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: initial; border-right-color: initial; border-bottom-color: initial; border-left-color: rgb(238, 238, 238); border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; quotes: none; color: rgb(119, 119, 119);\">\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: 1.25; font-family: inherit; font-size: 16.25px; vertical-align: baseline; min-height: 1px; color: rgb(145, 18, 123); text-align: justify;\">\r\n		<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">ALIMENTO SUPER PREMIUM PARA PERROS ADULTOS DE RAZAS PEQUE&Ntilde;AS (A PARTIR DE LOS 10 MESES DE VIDA)</strong></p>\r\n</blockquote>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	A partir de los 10 meses de vida, tu perro de raza peque&ntilde;a alcanza la madurez y necesita una dieta equilibrada para esta nueva etapa. Optimanova Adult Mini Chicken &amp; Rice le ayudar&aacute; a mantener su peso ideal, gracias a un &oacute;ptimo aporte de calor&iacute;as y prote&iacute;nas especialmente adaptado a sus caracter&iacute;sticas. Contiene vitaminas y amino&aacute;cidos que protegen su piel y refuerzan el sistema inmunol&oacute;gico. Su f&oacute;rmula especial de alta palatabilidad y sus croquetas con estructura especial para mand&iacute;bulas peque&ntilde;as, dan como resultado una receta ideal para los paladares m&aacute;s exigentes.</p>\r\n<blockquote style=\"box-sizing: border-box; margin: 0px 0px 18px; padding: 9px 18px; border-width: 0px 0px 0px 5px; border-top-style: initial; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: initial; border-right-color: initial; border-bottom-color: initial; border-left-color: rgb(238, 238, 238); border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; quotes: none; color: rgb(119, 119, 119);\">\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: 1.25; font-family: inherit; font-size: 16.25px; vertical-align: baseline; min-height: 1px; color: rgb(145, 18, 123); text-align: justify;\">\r\n		<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">65<span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 0; font-family: inherit; font-size: 12.1875px; vertical-align: baseline; position: relative; top: -0.5em;\">%</span>&nbsp;CARNE DE POLLO</strong></p>\r\n</blockquote>\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 9px; padding-right: 0px; padding-left: 15px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores homologados para consumo humano.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		Una sola fuente de prote&iacute;na animal.</li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Composici&oacute;n:</strong>&nbsp;Pollo fresco (35%), Harina de pollo (25%), Arroz (15%), Hidrolizado de h&iacute;gado de pollo (5%), Aceite de pollo, Levadura (3%), Pulpa de remolacha, Aceite de pescado, Prote&iacute;na de arroz, Cloruro s&oacute;dico, Fosfato monoc&aacute;lcico, Cloruro pot&aacute;sico, Inulina (500 mg/Kg-&shy;&#8208;FOS), Manano-&shy;oligo-&shy;sac&aacute;ridos (130 mg/Kg), Extracto de yucca.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Constituyentes Anal&iacute;ticos:</strong>&nbsp;Prote&iacute;na bruta 27,00 %, Aceites y grasas brutos 17,00 %, EPA + DHA 750 mg/kg, Fibras brutas 2,00 %, Ceniza bruta 8,00 %, Calcio 1,20 %, F&oacute;sforo 1,00 %.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Aditivos:</strong>&nbsp;Vitamina A 18.000 UI/Kg. Vitamina D3 1.800 UI/Kg. Vitamina E 400 mg/ Kg. Vitamina C 125 mg/Kg. Hierro (sulfato ferroso monohidratado) 68 mg/Kg. Yodo (Yoduro pot&aacute;sico) 3,2 mg/Kg. Cobre (Sulfato c&uacute;prico pentahidratado) 9 mg/Kg. Manganeso (sulfato manganoso monohidratado) 6,8 mg/Kg. Zinc (&oacute;xido de zinc) 135 mg/Kg. Selenio 0,1 mg/Kg. Tecnol&oacute;gicos: Antioxidantes naturales (tocoferoles).</p>\r\n<blockquote style=\"box-sizing: border-box; margin: 0px 0px 18px; padding: 9px 18px; border-width: 0px 0px 0px 5px; border-top-style: initial; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: initial; border-right-color: initial; border-bottom-color: initial; border-left-color: rgb(238, 238, 238); border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; quotes: none; color: rgb(119, 119, 119);\">\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: 1.25; font-family: inherit; font-size: 16.25px; vertical-align: baseline; min-height: 1px; color: rgb(145, 18, 123); text-align: justify;\">\r\n		<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Los beneficios de ADULT MINI CHICKEN AND RICE</strong></p>\r\n</blockquote>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">IMMUNITY CONTROL PROGRAM:</strong>&nbsp;Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">HIGH DIGESTIBILITY:</strong>&nbsp;La elevada digestibilidad de los nutrientes permiten la m&aacute;xima absorci&oacute;n de &eacute;stos, aprovechando al m&aacute;ximo sus elementos nutritivos y estimulando la salud intestinal.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">DIGESTIVE HEALTH SYSTEM:&nbsp;</strong>El efecto prebi&oacute;tico del FOS, estimula la flora bacteriana beneficiosa del sistema digestivo (efecto b&iacute;fidus), Los MOS eliminan la flora perjudicial, logrando una mejor salud digestiva.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">SKIN &amp; COAT:&nbsp;</strong>La presencia del Zinc ayuda a la regeneraci&oacute;n de la piel, manteni&eacute;ndola en un estado sano y vigoroso. Los &aacute;cidos grasos la fortalecen y consiguen un pelo fuerte y brillante.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119); text-align: justify;\">\r\n	<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">HIGH PALATABILITY:&nbsp;</strong>La elevada calidad y frescura de los ingredientes, junto a una excelente combinaci&oacute;n de aceites y carne de pollo, consiguen una m&aacute;xima apetencia estimulando el consumo del alimento.</p>\r\n<blockquote style=\"box-sizing: border-box; margin: 0px 0px 18px; padding: 9px 18px; border-width: 0px 0px 0px 5px; border-top-style: initial; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: initial; border-right-color: initial; border-bottom-color: initial; border-left-color: rgb(238, 238, 238); border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; quotes: none; color: rgb(119, 119, 119);\">\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: 1.25; font-family: inherit; font-size: 16.25px; vertical-align: baseline; min-height: 1px; text-align: justify;\">\r\n		<span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(145, 18, 123);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Comparativa realizada con la informaci&oacute;n en el envase de los productos ADULT MINI</strong></span></p>\r\n</blockquote>\r\n<table style=\"margin: 0px auto; padding: 0px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; max-width: 100%; color: rgb(119, 119, 119);\">\r\n	<tbody style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n			<td style=\"box-sizing: border-box; margin: 0px; padding: 9px 10px; border-width: 0px; border-style: initial; border-color: initial; font-style: inherit; font-variant: inheri